import React from 'react';
import { Link } from 'react-router-dom';
import { Space } from 'antd';

function Header() {
  return (
    <div style={{ padding: 20, backgroundColor: '#f0f2f5' }}>
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
    </div>
  );
}

export default Header;
